import React, { useEffect } from "react";
import manitobaMap from "../images/ManitobaFFF.jpg";
import ontarioMap from "../images/OntarioFFF.jpg"
import "./Locations.css";

const Locations = () => {

  useEffect(() => {
    const navbar = document.querySelector('.nav-bar');
    if (navbar) {
      navbar.style.display = 'none';
    }

    // Cleanup when the component unmounts
    return () => {
      if (navbar) {
        navbar.style.display = 'block'; // Restore the navbar on unmount
      }
    };
  }, []);

  return (
    <div className="main">
      <section id="locations"></section>
      <div className="locations">
      <div className="province_1">
        <ul>
          <li>Manitoba</li>
          <li>Winnipeg</li>
          <li>Brandon</li>
        </ul>

        <img src={manitobaMap} alt="manitoba_map" />
      </div>
      <div className="province_2">
        <img src={ontarioMap} alt="ontario_map" />
        <ul>
          <li>Ontario</li>
          <li>Toronto</li>
          <li>London</li>
        </ul> 
      </div>
      </div>
    </div>
  );
};

export default Locations;
